    false,nt"url": null,nt"notes": "The Rainwater Basin (RWB) area encompasses
    over 4,200 square miles within 17 counties of southcentral Nebraska. Within the
    RWB area, the U.S. Fish and Wildlife Service (Service) administers 62 Waterfowl
    Production Areas (WPA) ranging from approximately 20 to 2,000 acres. Prior to the
    phase out of lead shot, an estimated 2.7 million kilograms of lead shot were deposited
    annually in lakes and marshes of the United States (USFWS 1976). Ingestion of this
    shot by birds can be lethal. Bellrose (1959) estimated that lead poisoning may result
    in a 2-3 percent annual loss to the North American waterfowl population. During
    the summers of 1997 and 1998, sediment samples were collected from five WPAs in
    the Rainwater Basins, Nebraska to determine the extent of lead shot deposition.
    Two of the basins sampled exceeded the concentration of concern for lead shot presence,
    20,000 lead shot per acre (Anderson 1982). The samples collected at Mallard Haven
    WPA revealed a lead shot concentration of 19,466 and a 95 percent confidence interval
    of 12,150 - 26,782. Harvard WPA contained the highest concentrations of lead shot
    of all basin sampled. Processed samples revealed concentrations of 50,736 lead shot
    per acre with a 95% confidence interval of 42,464 - 59,008 lead shot per acre. Both
    of these basins were recommended for remediation.",nt"license_title": "License
